import{_ as e,c as a,o as t,a as r}from"./app.45af3079.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"从哪里开始说起呢？","slug":"从哪里开始说起呢","link":"#从哪里开始说起呢","children":[]},{"level":2,"title":"啥也不会，我很着急","slug":"啥也不会-我很着急","link":"#啥也不会-我很着急","children":[]},{"level":2,"title":"找到工作，选择躺平","slug":"找到工作-选择躺平","link":"#找到工作-选择躺平","children":[]},{"level":2,"title":"工作之后","slug":"工作之后","link":"#工作之后","children":[]},{"level":2,"title":"未来计划","slug":"未来计划","link":"#未来计划","children":[]}],"relativePath":"essay/2022.md","lastUpdated":1673275088000}'),i={name:"essay/2022.md"},l=r('<h2 id="从哪里开始说起呢" tabindex="-1">从哪里开始说起呢？ <a class="header-anchor" href="#从哪里开始说起呢" aria-hidden="true">#</a></h2><p>我是2022届本科毕业生，专业是计算机科学与技术。 从2021年10月开始找工作，当时选择了前端这个方向，因为受宿舍对面两位大佬的影响从2021年系统学习前端，之前也有学习，跟着大佬推荐的视频学习，但是一直云里雾里的。之后也是三天打鱼两天晒网，根本没有学多少东西。</p><h2 id="啥也不会-我很着急" tabindex="-1">啥也不会，我很着急 <a class="header-anchor" href="#啥也不会-我很着急" aria-hidden="true">#</a></h2><p>等到了21年8月，同学们有的都收到心仪的offer了，我才开始着急。通过海量投递简历，我接到了很多面试，也有了几个offer，但是都没着急去，因为我想完成手头上正在写的一个项目，一个功能强大的todolist吧，前端+后端+部署，我当时是希望能通过这个完整的项目能给我的简历加分，现在想来都没啥用，因为简历在现在的我看来就是个垃圾，看都不想看一眼。</p><h2 id="找到工作-选择躺平" tabindex="-1">找到工作，选择躺平 <a class="header-anchor" href="#找到工作-选择躺平" aria-hidden="true">#</a></h2><p>后来有个不错的offer——一个做医疗器械的公司，实习工资给的多，我想着是实习完了之后就换一家，但没想到呀，一直待到了现在。当时也没见过世面，认为公司给的工资很多了，后来跟同学们一对比，数我垃圾，没办法呀，当时太菜也没心思在找，而且这个单位提供一年的住宿，是公寓，环境还挺好，公司也是做呼吸机，肯定是挣钱的，稳定，如果我再找的话，以我当时的能力，估计也拿不到好的offer了，所以就没舍得走。</p><h2 id="工作之后" tabindex="-1">工作之后 <a class="header-anchor" href="#工作之后" aria-hidden="true">#</a></h2><p>说实话，来公司第一天我就想润了，公司是传统公司，一切就很传统，和我想象的完全不一样。我心仪的是那种Google式的大学氛围。呆了一周更想润了。 入职那天，在会议室填了一堆东西，然后hr就带我们到部门工位上，简单介绍了一下，然后等it 帮我把电脑安装好，我自己配置完环境就没啥事儿了，就一直没啥事儿，我就问我们到技术老大各种问题，没敢多问，怕打扰工作。然后我每天上班就自己学点东西，偏开发常识。然后就是看公司项目代码，当时觉得这代码真nb，我啥时候能写出来，现在-&gt;这特么谁写的代码，问题太多了，是的 之后的日子里时不时得得改一下那些老项目的bug 或者添加一下需求。 后来接了一些需求，开发一些东西，让我越来越觉得，这部门真随意，项目管理混乱，我可以随便改东西，随便能提交代码，没有review，git 分支混乱，好像是缺胳膊少腿的开发流程，感觉我脱节了一样。导师不主动交东西，没有技术氛围，什么都是自己写，我这一身技术，工作中学到的我觉得都没有1%，……</p><h2 id="未来计划" tabindex="-1">未来计划 <a class="header-anchor" href="#未来计划" aria-hidden="true">#</a></h2><p>技术是永远学不完的，2022踩的坑就是 23年学一些对找工作有帮助的东西吧，并且写一些拿得出手的项目 收藏的东西都别吃灰喽，整理整理 都看看</p>',10),d=[l];function n(s,h,o,c,_,p){return t(),a("div",null,d)}const g=e(i,[["render",n]]);export{u as __pageData,g as default};
